import styled from "styled-components";
import { Avatar } from "../../container/style";

const Profile = () => {
	return (
		<>
			<LayoutProfile>
				<Profiles>
					<AvatarProfile />
				</Profiles>
			</LayoutProfile>
		</>
	);
};
export default Profile;

const LayoutProfile = styled.div`
	background-color: red;
`;
const Profiles = styled.div`
	background-color: gainsboro;
	width: 70%;
	margin: auto;
	height: 400px;
`;
const AvatarProfile = styled.div`
	background-color: green;
	width: 10rem;
	border-radius: 80px;
	height: 10rem;
`;;
